import React from 'react';

const AdviceCard = ({ advice }) => {
  return (
    <div className='advice-card'>
      <h2>ADVICE #117</h2>
      <ul>
        {advices.map(advice => (
          <li key={advice.id}>{advice.advice}</li>
        ))}
      </ul>
    </div>
  );
};

export default AdviceCard;
